Σημειώστε ότι ο %1$s προσκλήθηκε σε %2$d ομάδες στις οποίες ανήκετε. Θα προστεθεί ξανά σε αυτήν τη λίστα εάν συμμετάσχει σε μία από αυτές. Ίσως θελήσετε να αποχωρήσετε από αυτές τις ομάδες για να αποφύγετε αυτό.

